export const isFormValid = () => {
    // Example validation: Check if email is valid
    const emailRegex = /\S+@\S+\.\S+/;
    if (!emailRegex.test(formData.email)) {
        console.error("Invalid email address.");
        return false;
    }
    // Add other validation checks as needed
    return true;
};
